import React from "react";

const Status = (status) => {
    if (status === true) {
        return <div style={{ backgroundColor: '#6eeb94' }}>Approve</div>
    } else {
        return <div style={{ backgroundColor: '#ff2121' }}>Reject</div>
    }
}

export default Status
